[PixAndVideo] - Angel Blade - The Last Guest [21Sextury] - NEW 21 OCTOBER 2014 NEW

It is almost closing time. There is only one guest left in the bar. Her name is Angel Blade and she stayed for so long only to wait for the handsome waiter, Zack. Since nobody else is around, he thinks that having a little fun after a long day of work wouldn't hurt anyone. Besides, Angel deserves a little something for her patience and devotion, right?


